Text:
@jeof22: try using VLC, there's also a MAC version available. Subtitles are available under the video options.

Oh an thanks for the upload GoodFilms :-) The video quality is very good regarding the file size but most likely not as good as CBGB's 1080p version xD Considering the quality of the movie itself (content-wise), a 720p rip is enough in my point of view :D

For the video playback I start recomending other players than VLC because I recognize artefacts and pixel blocks while watching "high bitrate" BDRips... so try using KMPlayer or something like this if you are faced with quality problems.
